import React from 'react';
import { Navbar, Container } from 'react-bootstrap';

const Navigationbar = () => {
    return (
        <Navbar bg="dark">
            <Container>
                <Navbar.Brand href="#home">
                    Spaceagram
                </Navbar.Brand>
            </Container>
        </Navbar>
    )
}

export default Navigationbar
